def variacion1():
    vr1.delete(0,END)
    m = txt1.get()
    n = txt2.get()
    m1 = int(m)
    n1 = int(n)
    r = (math.factorial(m1) / math.factorial(m1 - n1))
    vr1.insert(0,int(r))

def variacion2():
    vr2.delete(0,END)
    m = txt1.get()
    n = txt2.get()
    m1 = int(m)
    n1 = int(n)
    r = math.pow(m1,n1)
    vr2.insert(0,(int(r)))

