def combinacion1():
    cm1.delete(0,END)
    m = txt1.get()
    n = txt2.get()
    m1 = int(m)
    n1 = int(n)
    r = math.factorial(m1) / (math.factorial(n1) * (math.factorial(m1 - n1)))
    cm1.insert(0,(int(r)))

def combinacion2():
    cm2.delete(0,END)
    m = txt1.get()
    n = txt2.get()
    m1 = int(m)
    n1 = int(n)
    r = math.factorial(m1 + n1 - 1) / (math.factorial(n1) * (math.factorial(m1 - 1)))
    cm2.insert(0,(int(r)))

